             public string GetQualityClassCssClass(string qualityClass)
            {
                switch (qualityClass?.ToLower())
                {
                    case "viscose":
                        return "quality-class-viscose";
                    case "rayon":
                    case "rynsignart":
                        return "quality-class-rayon";
                    case "cotton":
                        return "quality-class-cotton";
                    case "nylon":
                        return "quality-class-nylon";
